func shortestPathBinaryMatrix(grid [][]int) int {
	n := len(grid) - 1
	if grid[0][0] == 1 || grid[n][n] == 1 {
		return -1
	}
	if n == 0 {
		return 1
	}
	grid[0][0] = 1
	return path(grid, n)
}

type cell struct {
	x, y int
}

func next(g [][]int, n, x, y int) []*cell {
	var ch []*cell
	d := g[x][y] + 1
	app := func(x, y int) {
		if g[x][y] > 0 {
			return
		}
		g[x][y] = d
		ch = append(ch, &cell{
			x: x,
			y: y,
		})
	}
	xi, xj := x, x
	yi, yj := y, y
	if x > 0 {
		xi--
	}
	if y > 0 {
		yi--
	}
	if x < n {
		xj++
	}
	if y < n {
		yj++
	}
	for ; xi <= xj; xi++ {
		for j := yi; j <= yj; j++ {
			app(xi, j)
		}
	}
	return ch
}

func path(g [][]int, n int) (min int) {
	ch := next(g, n, 0, 0)
	for len(ch) > 0 {
		var nc []*cell
		for _, c := range ch {
			if c.x == n && c.y == n {
				return g[n][n]
			}
			nc = append(nc, next(g, n, c.x, c.y)...)
		}
		ch = nc
	}
	return -1
}
